import React, { useState } from 'react';
import getAllConsultation from "../services/userServices"
import {Link} from "react-router-dom"


const ViewAllUsers = ({ data }) => {
  const [filters, setFilters] = useState({
  
    patientName: '',

  });

  


  const filteredData = data?.filter(item => {
    return (
      
      item.patientName.toLowerCase().includes(filters.patientName.toLowerCase()) 

    );
  });

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  return (
    <div>
    <div className="p-4 max-w-md mx-auto">
      <div className="mb-4">

        <input
          type="text"
          name="patientName"
          value={filters.patientName}
          onChange={handleInputChange}
          placeholder="Filter by patient name"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
   
      </div>
      

      </div>
      <div className="container">
      <div className="mt-8">
        <h2 className="text-xl font-bold mb-4"> Officer's  Consultations</h2>
        <th className="py-2 px-4 border-b">Filter Record
                </th>
        <div className="overflow-x-auto">
        
          <table className="min-w-full bg-white border border-gray-300">
            <thead>
              <tr>
                <th className="py-2 px-4 border-b">Date</th>
                <th className="py-2 px-4 border-b">Patient</th>
                <th className="py-2 px-4 border-b">Healthcare Provider</th>
                <th className="py-2 px-4 border-b">Consultation Type</th>
                <th className="py-2 px-4 border-b">Medical Condition</th>
                <th className="py-2 px-4 border-b">Book Consultation</th>
                

              </tr>
            </thead>
            {filteredData?.length >0 ? ( filteredData?.map((consultation, key) => (
            <tbody>
              
                <tr key={key}>
                  <td className="py-2 px-4 border-b">{new Date(consultation.date).toLocaleDateString()}</td>
                  <td className="py-2 px-4 border-b">{consultation.patientName}</td>
                  <td className="py-2 px-4 border-b">{consultation.healthcareProvider}</td>
                  <td className="py-2 px-4 border-b">{consultation.consultationType}</td>
                  <td className="py-2 px-4 border-b">{consultation.medicalCondition}</td>
                  <td className="py-2 px-4 border-b ">Add Consultation</td>
                  <td>  
                  </td>
                </tr>
             
            </tbody>
              ))):(
                <h1 className=''> You Don't Have Consultation</h1>
              )}
          </table>
         
        
      
        </div>
      </div>
    </div>
      </div>
  );
};

export default ViewAllUsers 
  ;
